Qmt chat is a simple, secure, private and professional real-time encrypted chat software.

Friends chat freely: unlimited information, anytime and anywhere communication reply, improve communication efficiency;

Powerful group control: it can freely create multiple group chats, protect group members, forbid group members, avoid disturbing group messages, set up group administrators and other rich group management functions;

Burn after reading: the countdown of chat content disappears without leaving a trace;

Two way recall: the content of the sent message can be recalled in two ways within 5 minutes, and the recalled data can be overlapped and deleted for many times and cannot be recovered;

Application security lock: enable the security lock. After setting the unlock password, you need to input the unlock password every time you enter the application to prevent others from peeping;

Information security: qmt chat does not obtain personal privacy information, does not obtain address book permissions, randomly generates QmtChat ID;

QmtChat，Chat freely ~
